import tinMiloImage from '../assets/milo.jpg';
import niveaImage from '../assets/nivea.jpg';
const products = [
  {
    id: 1,
    name: 'Tin Milo',
    price: 5.99,
    image: '.src/assets/milo.jpg',
    category: 'Beverages'
  },
  {
    id: 2,
    name: 'Nivea Cream',
    price: 7.23,
    image: '.src/assets/nivea,jpg',
    category: 'Body-Cream'
  },
  {
    id: 3,
    name: 'Bluetooth Speaker',
    price: 39.99,
    image: 'https://via.placeholder.com/300x300?text=Speaker',
    category: 'Audio'
  },
  {
    id: 4,
    name: 'Gaming Mouse',
    price: 29.99,
    image: 'https://via.placeholder.com/300x300?text=Gaming+Mouse',
    category: 'Gaming'
  },
  {
    id: 5,
    name: 'Laptop Bag',
    price: 49.99,
    image: 'https://via.placeholder.com/300x300?text=Laptop+Bag',
    category: 'Accessories'
  }
];

export default products;
